// import { render } from '@testing-library/react';
import React from 'react';
import homeButton from './home.png';
import './Header.css';

const Header = (props) => {

  const message = () => {
    console.log('hello')
  }

  return (
    <header>
      <h1>Radioactive Toothbrushes</h1>
      <button onClick={event => this.message}>
        <img
          className='home-icon'
          src={homeButton}
          alt='home'
        />
      </button>
    </header>
  )
}

export default Header;
